import React from 'react'



 const App = () => {
     const title = "Welcome to the new blog";
     const likes = 50;
    //  const person = { name: "yoshi", age:30} 
    //  exp objects and booleans can't be output

  return (
    <div>
        <div className="content">
            <h1> { title } </h1>
            <p> Liked { likes } times</p>
           
        </div>
    </div>
  )
}

export default App
